import React from "react";

const Eat = props => {
  let eats = props.dataString.filter(item => item.type === "eat");
  console.log(eats);
  return (
    <div class="container mb-5">
      <h1>Eat</h1>
      {eats.map(eat => (
        <div class="row mt-5 pt-4">
          <div class="col-sm col-md-4 ">
            <img
              className="w-100"
              alt="food"
              src="https://source.unsplash.com/1600x900/?food"
            ></img>
          </div>
          <div class="col-sm col-md-8">
            <h3>{eat.title}</h3>
            <p>{eat.description}</p>
            <p>
              {eat.address}, {eat.phone}
            </p>
            <a href="wikipedia.com">{eat.website}</a>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Eat;
